import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';
import Nav from "./components/Nav";

const App = () =>
  <Router>
    <div>
      <Route path="/" component={Home} />
    </div>
  </Router>;

export default App;
